CREATE TABLE "productslist" (
  "id" int PRIMARY KEY,
  "item_name" VARCHAR(50),
  "type_name" VARCHAR(50),
  "rank" INT,
  "cost" INT
);

CREATE TABLE "customers" (
  "id" int PRIMARY KEY,
  "basket_id" int,
  "cust_name" VARCHAR(50),
  "cust_email" VARCHAR(50),
  "cust_phone_number" VARCHAR(50),
  "cust_location" VARCHAR(50),
  "cust_payment" VARCHAR(50)
);

CREATE TABLE "basket" (
  "id" int PRIMARY KEY,
  "cost" VARCHAR(50),
  "counter" INT,
  "productslist_id" INT
);

CREATE TABLE "company" (
  "id" int PRIMARY KEY,
  "country" VARCHAR(50),
  "productslist_id" INT
);

ALTER TABLE "customers" ADD FOREIGN KEY ("basket_id") REFERENCES "basket" ("id");

ALTER TABLE "basket" ADD FOREIGN KEY ("productslist_id") REFERENCES "productslist" ("id");

ALTER TABLE "company" ADD FOREIGN KEY ("productslist_id") REFERENCES "productslist" ("id");











